import React from 'react';
import { Link, withRouter } from 'react-router-dom';

const SideMenuComponent = ({ history }) => {
  const handleLogout = () => {
    // Perform the logout operation here, e.g., clearing a token or session.

    // After performing the logout operation, redirect to the login page.
    history.push('/');
  };

  return (
    <div className="side-menu">
      <ul>
        <li><Link to="/login" className="nav-button">Login</Link></li>
        <li><Link to="/signup" className="nav-button">Signup</Link></li>
        <li><Link to="/" className="nav-button">Home</Link></li>
        <li onClick={handleLogout} className="nav-button">Logout</li>
      </ul>
    </div>
  );
};

export default withRouter(SideMenuComponent);
